import { useEffect, useState } from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import Counting from "./Counting";

function Joke() {
    const QUO = Math.floor(1000/7);

    const [isGhoul, setIsGhoul] = useState(false);
    const [counts, setCounts] = useState(1000);
    const [components, setComponents] = useState([]);

    useEffect(() => {
        let num = 1000;
        if(isGhoul && counts - 7 > 0)
            setTimeout(() => {
                setComponents([ ...components, num.toString() + ' - 7 = ' + (num-7).toString()]);
                num -= 7;
            }, 1000);
    });


   return(
        <div className={'container'}>
            <button type="button" className="btn btn-dark" onClick={() => {
                setIsGhoul(true);
            }}>
                Я гуль :(
            </button>
            <Counting counts={ [components] } />
        </div>
    )
}



export default Joke;
